import { Link } from 'react-router-dom';

export const Navbar = () => {
  const navItems = [
    { id: 1, text: 'Home', path: '/' },
    { id: 2, text: 'Card', path: '/card' },
    { id: 3, text: 'Create Card', path: '/createcard' },
  ];

  return (
    <div className='sticky max bg-black flex justify-between items-center h-19 max-w mx-auto px-4 text-white '>
      <h1 className='w-full text-3xl font-bold text-[#00df9a]'>WebSite</h1>
      <ul className='hidden md:flex'>
        {navItems.map(item => (
          <li key={item.id} className='p-4 hover:bg-[#00df9a] rounded-xl m-2 cursor-pointer duration-300 hover:text-black'>
            <Link to={item.path}>{item.text}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Navbar;
